    <!-- modul -->
    <style>
        section.modul .modul-card {
            /* background-image: url(icons/calendar-date.svg); */
            background-repeat: no-repeat;
            background-size: 50%;
            /* background-color: #309FDB; */
            border-radius: 4px;
            /* padding: 1rem; */
            height: 80px;
            /* width: 200px; */
            display: flex;
            /* text-align: center; */
            justify-content: center;
            align-items: center;
        }

        section.modul .modul-card:hover {
            cursor: pointer;
        }

        section.modul .modul-card.satu {
            background-color: #2DB3AC;
        }

        section.modul .modul-card.dua {
            background-color: #309FDB;

        }

        section.modul .modul-card.tiga {
            background-color: #E85C63;

        }

        section.modul .modul-card.empat {
            background-color: #AA529B;

        }

        section.modul a {
            color: white;
            text-decoration: none;
        }

        section.modul .modul-card img {
            width: 30px;
            margin-left: 20px;
            display: none;
        }

        section.modul .modul-card p {
            margin-bottom: 0;
            text-transform: capitalize;
            font-size: 20px;
        }

        section.modul .modul-card .label {
            margin-right: 10px;
        }

        section.modul .modul-card i {
            position: relative;
            top: -15px;
            right: -5px;
        }
    </style>
    <section class="modul pt-4" id="modul">
        <div class="container">

            <div class="row">
                <div class="col-6 col-sm-6 col-md-3 col-lg-3 text-white pt-3">
                    <aa href="">
                        <div class="modul-card satu" onclick="mhs()">
                            <div class="label">
                                <p>mahasiswa</p>
                            </div>
                            <div>
                                <i class="fas fa-users"></i>
                            </div>
                            <img src="icons/calendar-date.svg" alt="">
                        </div>
                    </aa>
                </div>
                <div class="col-6 col-sm-6 col-md-3 col-lg-3 text-white pt-3">
                    <aa href="">
                        <div class="modul-card dua" onclick="dsn()">
                            <div class="label">
                                <p>dosen</p>
                            </div>
                            <div>
                                <i class="fas fa-chalkboard-teacher"></i>
                            </div>
                            <img src="icons/calendar-date.svg" alt="">
                        </div>
                    </aa>
                </div>
                <div class="col-6 col-sm-6 col-md-3 col-lg-3 text-white pt-3">
                    <aa href="">
                        <div class="modul-card tiga" onclick="file()">
                            <div class="label">
                                <p>files</p>
                            </div>
                            <div>
                                <i class="far fa-file-alt"></i>
                            </div>
                            <img src="icons/calendar-date.svg" alt="">
                        </div>
                    </aa>
                </div>
                <div class="col-6 col-sm-6 col-md-3 col-lg-3 text-white pt-3">
                    <aa href="">
                        <div class="modul-card empat" onclick="jdwl()">
                            <div class="label">
                                <p>jadwal</p>
                            </div>
                            <div>
                                <i class="far fa-calendar-alt"></i>
                            </div>
                            <img src="icons/calendar-date.svg" alt="">
                        </div>
                    </aa>
                </div>
            </div>
        </div>
    </section>
    <!-- end modul -->

        }

    <style>

            display: none;

                    <div class="alert bg-danger text-white">belum ada data.</div>

    </section>

        }

            height: 400px;
            width: 100%;

    <style>
        #jadwal {
            display: none;
        }

                <div class="col-4">
                    <div class="alert bg-danger text-white">belum ada data.</div>

            </div>
        </div>
    </section>

    <script>

        // ONCLICK
        // mhs
        // dsn
        // file

        // ID
        // mahasiswa
        // dosen
        // files
        // jadwal


        var mahasiswa = document.getElementById("mahasiswa");
        var dosen = document.getElementById("dosen");
        var files = document.getElementById("files");
        var jadwal = document.getElementById("jadwal");
        var ucapan = document.getElementById("ucapan");



        function mhs() {
            mahasiswa.style.display = "block";
            dosen.style.display = "none";
            files.style.display = "none";
            jadwal.style.display = "none";
            ucapan.style.display = "none";
        }

        function dsn() {
            mahasiswa.style.display = "none";
            dosen.style.display = "block";
            files.style.display = "none";
            jadwal.style.display = "none";
            ucapan.style.display = "none";
        }

        function file() {
            mahasiswa.style.display = "none";
            dosen.style.display = "none";
            files.style.display = "block";
            jadwal.style.display = "none";
            ucapan.style.display = "none";
        }

        function jdwl() {
            mahasiswa.style.display = "none";
            dosen.style.display = "none";
            files.style.display = "none";
            jadwal.style.display = "block";
            ucapan.style.display = "none";
        }

    </script>
